import images from "../Assets/images.jpg"

const Home = () => {

    return (

        <div class="flex flex-col">
       <div class="bg-blue-500 bg-opacity-100 w-1">1</div>
       <div class="bg-yellow-500 bg-opacity-100">2</div>
       <div class="bg-green-500 bg-opacity-100">3</div>
      </div>
    );
}

export default Home;
